import React from 'react';

export const NavBar = () => {
    return (
        // <div className="w-screen flex flex-row items-center p-1 justify-between bg-white shadow-s">
        <div className="grid grid-cols-12 gap-1">
            <div className=" col-span-1  text-lg text-gray-700">Test</div>
            <span className="col-span-6 w-screen md:w-1/3 h-10 bg-gray-200 cursor-pointer border border-gray-300 text-sm rounded-full flex">
                <input
                    type="search"
                    name="serch"
                    placeholder="Search"
                    className="flex-grow px-4 rounded-l-full rounded-r-full text-sm focus:outline-none"
                />
                <i className="fas fa-search m-3 mr-5 text-lg text-gray-700 w-4 h-4"></i>
            </span>
            <div className=" col-span-2 flex flex-row-reverse mr-4 ml-4 md:hidden">
                <i className="fas fa-bars"></i>
            </div>
            <div className=" col-span-2 flex flex-row-reverse mr-8 hidden md:flex">
                <div className="text-gray-700 text-center bg-gray-400 px-4 py-2 m-2">Button</div>
                <div className="text-gray-700 text-center bg-gray-400 px-4 py-2 m-2">Link</div>
            </div>
        </div>
    );
};
